INSERT INTO `cgform_head` VALUES ('8a8080ce4110c410014110c4a83e0120', '动态报表配置抬头', 'admin', '2013-09-12 14:03:45', '管理员', 'N', 'N', 'Y', 'N', '2', '87', '$(function(){\r\n$(\"body\").append(\"<link href=\\\"plug-in/lhgDialog/skins/default.css\\\" rel=\\\"stylesheet\\\" id=\\\"lhgdialoglink\\\">\");\r\nvar $btn = $(\"<div class=\\\"ui_buttons\\\"  style=\\\"display:inline-block;\\\"><input style=\\\"position: relative;top: -8px;\\\" class=\\\"ui_state_highlight\\\" type=\\\"button\\\" value=\\\"sql解析\\\"        id=\\\"sqlAnalyze\\\" /></div>\");\r\n$(\"#cgr_sql\").after($btn);\r\n$btn.click(function(){\r\n $.ajax({\r\n     url:\"cgReportController.do?getFields\",\r\n    data:{sql:$(\"#cgr_sql\").val()},\r\n   type:\"Post\",\r\n    dataType:\"json\",\r\n    success:function(data){\r\n      if(data.status==\"success\"){\r\n         $(\"#add_jform_cgreport_item_table\").empty();\r\n      $.each(data.datas,function(index,e){\r\n        var $tr = $(\"#add_jform_cgreport_item_table_template tr\").clone();\r\n      $tr.find(\"td:eq(1) :text\").val(e);\r\n       $tr.find(\"td:eq(2) :text\").val(index);\r\n       $tr.find(\"td:eq(3) :text\").val(e);\r\n       $(\"#add_jform_cgreport_item_table\").append($tr);\r\n      }); \r\n    resetTrNum(\"add_jform_cgreport_item_table\");\r\n    }\r\n  }\r\n  });\r\n });\r\n});', 'single', 'select * from t_s_user', 'jform_cgreport_item', 'jform_cgreport_head', null, null, null);
